import React from 'react';
import Link from 'next/link';

import useWindowSize from '../../hooks/useWindowSize';
import { Main, BtnContainer, MenuBtn, Slide } from './style';

const ManagerPage = () => {
    const winSize = useWindowSize();

    return (
        <Main style={{height:winSize[1]}}>
            <Slide style={{width:winSize[0]*3}}>
                <div style={{width:winSize[0]}}>
                    <BtnContainer>
                        <MenuBtn>
                            주문 확인
                        </MenuBtn>
                        <MenuBtn>
                            재고 관리
                        </MenuBtn>
                    </BtnContainer>
                </div>
            </Slide>
        </Main>
    );
};

export default ManagerPage;
